import React from "react";

function MidDesText() {
  return (
    // <p className="t-mid-des-text">
    //   "It's important to understand your market by listening to your buyers.
    //   Your customers want to talk to you about the products they buy. I am
    //   passionate about building scalable data technologies that allow such
    //   communications to happen seemlessly online."
    // </p>
    <p className="t-mid-des-text">
      "Patrick has been such a professional and so polite each time. With such
      an easy service to call upon it really can be just a quick phone call or
      text to book an appointment. I'm getting alot older these days and it
      always helps to have greate respectable people take care of my garden for
      me"
    </p>
  );
}

export default MidDesText;
